import React from 'react';

const TokenInfoPage = () => {
  return (
    <div className="bg-gray-900 text-white min-h-screen">
      {/* Header Section */}
      <header className="text-center p-10">
        <h1 className="text-4xl font-bold">Vortrex Token (VTX)</h1>
        <p className="mt-4 text-xl">The future of decentralized finance is here!</p>
      </header>

      {/* Token Details Section */}
      <section className="py-10">
        <h2 className="text-3xl text-center">Token Details</h2>
        <ul className="mt-4 text-center">
          <li>Symbol: VTX</li>
          <li>Total Supply: 1,000,000,000 VTX</li>
          <li>Blockchain: Binance Smart Chain (BEP-20)</li>
        </ul>
      </section>

      {/* Use Cases Section */}
      <section className="py-10">
        <h2 className="text-3xl text-center">Use Cases</h2>
        <p className="mt-4 text-center">
          VTX is designed to be used for staking, governance, and as a utility token within the Vortrex ecosystem.
        </p>
      </section>
    </div>
  );
};

export default TokenInfoPage;
